import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import "./App.css"; // Importing CSS for additional styles

// Navbar Component with Styling
const Navbar = () => (
  <nav style={styles.navbar}>
    <ul style={styles.navList}>
      <li><a href="/" style={styles.navLink}>Home</a></li>
      <li><a href="/about" style={styles.navLink}>About</a></li>
      <li><a href="/skills" style={styles.navLink}>Skills</a></li>
      <li><a href="/projects" style={styles.navLink}>Projects</a></li>
      <li><a href="/contact" style={styles.navLink}>Contact</a></li>
    </ul>
  </nav>
);

// Footer Component with Styling
const Footer = () => (
  <footer style={styles.footer}>
    <p>© 2025 Your Name. All rights reserved.</p>
  </footer>
);

// Home Component with Styling
const Home = () => (
  <section style={styles.section}>
    <h1 style={styles.heading}>Welcome to My Portfolio</h1>
    <p style={styles.paragraph}>Hi, I'm , a passionate developer.</p>
  </section>
);

// About Component
const About = () => (
  <section style={styles.section}>
    <h1 style={styles.heading}>About Me</h1>
    <p style={styles.paragraph}>Details about your background, education, and journey.</p>
  </section>
);

// Skills Component
const Skills = () => (
  <section style={styles.section}>
    <h1 style={styles.heading}>Skills</h1>
    <p style={styles.paragraph}>List of technical and soft skills with visuals.</p>
  </section>
);

// Projects Component
const Projects = () => (
  <section style={styles.section}>
    <h1 style={styles.heading}>Projects</h1>
    <p style={styles.paragraph}>Showcase of 3-5 projects with descriptions and links.</p>
  </section>
);

// Contact Component
const Contact = () => (
  <section style={styles.section}>
    <h1 style={styles.heading}>Contact</h1>
    <p style={styles.paragraph}>Contact form and social media links.</p>
  </section>
);

// Main App Component
const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/skills" element={<Skills />} />
        <Route path="/projects" element={<Projects />} />
        <Route path="/contact" element={<Contact />} />
      </Routes>
      <Footer />
    </Router>
  );
};

// Inline Styles for Components
const styles = {
  navbar: {
    backgroundColor: "#333",
    padding: "15px",
    textAlign: "center",
  },
  navList: {
    listStyle: "none",
    display: "flex",
    justifyContent: "center",
    padding: 0,
  },
  navLink: {
    color: "white",
    textDecoration: "none",
    fontSize: "18px",
    margin: "0 15px",
    fontWeight: "bold",
  },
  footer: {
    backgroundColor: "#333",
    color: "white",
    textAlign: "center",
    padding: "10px",
    marginTop: "20px",
  },
  section: {
    padding: "50px",
    textAlign: "center",
    backgroundColor: "#f4f4f4",
    borderRadius: "10px",
    margin: "20px",
  },
  heading: {
    color: "#333",
    fontSize: "28px",
  },
  paragraph: {
    color: "#555",
    fontSize: "18px",
  },
};

export default App;
